void display_start_logo()
{
	uint8 r,g,b;
	int x, y;
	int offx = video_info.width/2 - LOGO_WIDTH/2, offy = video_info.height/2 - LOGO_HEIGHT/2;
	uint8 *p = (uint8 *)logo_image_data;

	video_message_t msg;
	msg.m_type = VIDEO_MSG_WRITE_PIXEL;

	for(y = 0; y < LOGO_HEIGHT; y++){
		for(x = 0; x < LOGO_WIDTH; x++){
			b = *p++;
			g = *p++;
			r = *p++;

			msg.m_x = offx+x;
			msg.m_y = offy+y;
			msg.m_color = COLOR_RGB(r,g,b);
			video_transmit(&msg);
		}
	}

	char *str = OS_NAME;
	offx = video_info.width/2 - strlen(str)*8/2;
	offy = video_info.height/2 + 100;
	vram_draw_string(offx, offy, str, COLOR_WHITE);
	
	str = OS_VERSION;
	offx = video_info.width/2 - strlen(str)*8/2;
	offy += 20;
	vram_draw_string(offx, offy, str, COLOR_WHITE);
	
	str = OS_COPYRIGHT;
	offx = video_info.width/2 - strlen(str)*8/2;
	offy += 20;
	vram_draw_string(offx, offy, str, COLOR_WHITE);
}
#ifdef _NONE_
int jpeg_draw_picture(uint8 *buffer, const char *filename, int x, int y)
{
	printk("JPEG: name:%s\n", filename);
	/*1.检测文件是否存在*/
	int ack = fs.access(filename, F_OK);
	if(ack == -1){
		printk("JPEG: file %s not exist!\n", filename);
		return -1;
	}
	/*搭建JPEG解析环境*/
	struct DLL_STRPICENV env;
	env.work = mm.malloc(JPEG_MAX_WIDTH*JPEG_MAX_HEIGHT*4);
	
	/*获取文件大小*/
	struct stat fstat;
	fs.stat(filename, &fstat);
	printk("JPEG: file size:%d\n", fstat.st_size);
	
	uint8 *filebuf = (uint8 *)mm.malloc(fstat.st_size);
	if(filebuf == NULL){
		printk("JPEG: alloc memory for buf failed!\n");
		mm.free(env.work);
		
		return -1;
	}
	/*打开文件*/
	int fd = fs.open(filename, O_RDONLY);
	if (fd == -1){
		printk("JPEG: %s file open failed!", filename);
		mm.free(filebuf);
		mm.free(env.work);
		
		return -1;
	}
	/*读取文件*/
	if(fs.read(fd, filebuf, fstat.st_size) != fstat.st_size){
		printk("JPEG: %s file read failed!", filename);
		mm.free(filebuf);
		mm.free(env.work);
		fs.close(fd);
		return -1;
	}
	
	fs.close(fd);
	
	int info[8], i, j;
	/*获取图片信息*/
	if (info_JPEG(&env, info, fstat.st_size, filebuf) == 0) {
		printk("JPEG: %s file type unknown!\n", filename);
		mm.free(filebuf);
		mm.free(env.work);
		
		return -1;
	}
	
	printk("JPEG: file info: width %d ,height %d.\n", info[2], info[3]);
	
	if (info[2] > JPEG_MAX_WIDTH || info[3] > JPEG_MAX_HEIGHT) {
		printk("JPEG: picture too large.\n");
		mm.free(filebuf);
		mm.free(env.work);
		
		return -1;
	}
	
	struct jpeg_RGB *picbuf = (struct jpeg_RGB *)mm.malloc(info[2]*info[3]*4);
	struct jpeg_RGB *p;

	if(picbuf == NULL){
		printk("JPEG: alloc memory for buf failed!\n");
		mm.free(filebuf);
		mm.free(env.work);
		
		return -1;
	}
	/*解析文件*/
	i = decode0_JPEG(&env, fstat.st_size, filebuf, 4, (uint8 *) picbuf, 0);
	if(i != 0){
		printk("JPEG: picture decode failed!\n");
		mm.free(filebuf);
		mm.free(picbuf);
		mm.free(env.work);
		
		return -1;
	}
	
	/*把文件数据写入到缓冲区*/
	uint32 color;
	for(j = 0; j < info[3]; j++){
		p = picbuf + j * info[2];
		for(i = 0; i < info[2]; i++){
			color = RGB(p[i].r, p[i].g, p[i].b);
			/*写入到缓冲区*/
			graph_write_pixel(buffer, x+i, y+j, color);
		}
	}
	/*显示到屏幕上*/
	graph_refresh(buffer, x, y, x + info[2],y + info[3]);
	
	/*释放资源并且返回*/
	mm.free(filebuf);
	mm.free(picbuf);
	mm.free(env.work);
	
	return 0;
}
#endif

/*these are used for start logo*/
void vram_draw_word_bits(int x, int y , uint8 *ascii, uint32 color)
{
	int i;
	char d;
	video_message_t msg;
	msg.m_type = VIDEO_MSG_WRITE_PIXEL;

	msg.m_color = color;
	for (i = 0; i < 16; i++) {
		d = ascii[i];
		msg.m_y = y + i;
		if ((d & 0x80) != 0) { 
			msg.m_x = x + 0;
			video_transmit(&msg);
		}
		if ((d & 0x40) != 0) { 
			msg.m_x = x + 1;
			video_transmit(&msg);
		}
		if ((d & 0x20) != 0) { 
			msg.m_x = x + 2;
			video_transmit(&msg);
		}
		if ((d & 0x10) != 0) { 
			msg.m_x = x + 3;
			video_transmit(&msg);
		}
		if ((d & 0x08) != 0) { 
			msg.m_x = x + 4;
			video_transmit(&msg);
		}
		if ((d & 0x04) != 0) { 
			msg.m_x = x + 5;
			video_transmit(&msg);
		}
		if ((d & 0x02) != 0) { 
			msg.m_x = x + 6;
			video_transmit(&msg);
		}
		if ((d & 0x01) != 0) { 
			msg.m_x = x + 7;
			video_transmit(&msg);
		}
	}
}

void vram_draw_word(int x, int y, char ch, uint32 color)
{
	vram_draw_word_bits(x, y, standard_font + ch * 16, color);
}

void vram_draw_string(int x, int y, char *s, uint32 color)
{
	while(*s != 0x00){
		vram_draw_word(x, y, *s, color);
		x += 8;
		s++;
	}
}

